WorstProducts_1.query:
q =  load "${App.Datasets.MFG_SalesAgreementProductSchedule_tp.FullyQualifiedName}";
q = filter q by 'SalesAgreementProduct.SalesAgreement.Status' in ["Activated"];
q = filter q by 'isValidProductSchedule' == "true";

q = foreach q generate q.'SalesAgreementProductId' as 'SalesAgreementProductId', q.'SalesAgreementProduct.Name' as 'SalesAgreementProduct.Name', (q.'DerivedActualAmount'/(daysBetween(toDate(q.'StartDate_sec_epoch'),case when toDate(q.'ActualEndDate_sec_epoch') < now() then toDate(q.'ActualEndDate_sec_epoch') else now() end)+1)) as 'ActualDailyAmount', 
(q.'ActualQuantity'/(daysBetween(toDate(q.'StartDate_sec_epoch'),case when toDate(q.'ActualEndDate_sec_epoch') < now() then toDate(q.'ActualEndDate_sec_epoch') else now() end)+1)) as 'ActualDailyQuantity', 
(case when toDate('StartDate_sec_epoch') > now() then 0 else (daysBetween((case when toDate('StartDate_sec_epoch') < toDate((toString(now(), "yyyy")+"-01-01"), "yyyy-MM-dd") && toDate('EndDate_sec_epoch') > toDate((toString(now(), "yyyy")+"-01-01"), "yyyy-MM-dd") then toDate((toString(now(), "yyyy")+"-01-01"), "yyyy-MM-dd") else toDate('StartDate_sec_epoch') end),case when toDate(q.'ActualEndDate_sec_epoch') < now() then toDate(q.'ActualEndDate_sec_epoch') else now() end)+1) end) as 'ActualDays_YTD', q.'PlannedAmountFinal' as 'PlannedAmountFinal', q.'PlannedQuantityFinal' as 'PlannedQuantityFinal', q.'PlannedDailyAmount' as 'PlannedDailyAmount', q.'PlannedDailyQuantity' as 'PlannedDailyQuantity';

q = foreach q generate q.'SalesAgreementProductId' as 'SalesAgreementProductId', q.'SalesAgreementProduct.Name' as 'SalesAgreementProduct.Name', (q.'ActualDailyAmount'*q.'ActualDays_YTD') as 'ActualAmountFinal', (q.ActualDailyQuantity*q.ActualDays_YTD) as 'ActualQuantityFinal', (q.'PlannedDailyAmount'*q.'ActualDays_YTD') as 'PlannedAmountFinal', (q.'PlannedDailyQuantity'*q.'ActualDays_YTD') as 'PlannedQuantityFinal', q.'ActualDailyQuantity' as 'ActualDailyQuantity', q.'PlannedDailyQuantity' as 'PlannedDailyQuantity';

result = group q by ('SalesAgreementProductId', 'SalesAgreementProduct.Name');
result = foreach result generate q.'SalesAgreementProductId' as 'SalesAgreementProductId', q.'SalesAgreementProduct.Name' 
as 'SalesAgreementProduct.Name', sum(q.'ActualAmountFinal') as 'A', sum(q.'ActualQuantityFinal') as 'B', sum(q.'PlannedAmountFinal') as 'C', sum((q.'ActualDailyQuantity'))/sum((q.'PlannedDailyQuantity')) as 'D', number_to_string(row_number() over([..] partition by all order by sum((q.'ActualDailyQuantity'))/sum((q.'PlannedDailyQuantity'))),"#,###") as 'RowNumber';
result = order result by ('D' asc, 'C' desc);
result = limit result 4;
row1 = foreach result generate null as 'SalesAgreementProductId', null as 'SalesAgreementProduct.Name', 0 as 'A', 0 as 'B', 0 as 'C', 0 as 'D', "A1" as RowNumber;
row2 = foreach result generate null as 'SalesAgreementProductId', null as 'SalesAgreementProduct.Name', 0 as 'A', 0 as 'B', 0 as 'C', 0 as 'D', "A2" as RowNumber;
row3 = foreach result generate null as 'SalesAgreementProductId', null as 'SalesAgreementProduct.Name', 0 as 'A', 0 as 'B', 0 as 'C', 0 as 'D', "A3" as RowNumber;
row4 = foreach result generate null as 'SalesAgreementProductId', null as 'SalesAgreementProduct.Name', 0 as 'A', 0 as 'B', 0 as 'C', 0 as 'D', "A4" as RowNumber;

final = union result, row1, row2, row3, row4;
final = group final by RowNumber;
final = foreach final generate RowNumber, coalesce(first('SalesAgreementProductId'),"NA") as 'SalesAgreementProductId', coalesce(first('SalesAgreementProduct.Name'),"NA") as 'SalesAgreementProduct.Name', sum('A') as 'A', sum('B') as 'B', sum('C') as 'C', sum('D') as 'D'; 
--final = order final by ('D' asc, 'C' desc);

